import React from 'react';
import ToDoItem from './toDoItem.js'

const Todo = ({item, onChange}) => {
return (<ul>
{

   item.map((item,id) => (
     <ToDoItem description={item.description} title={item.title} onChange={(e)=> {onChange(e)}} id={id}/>
 ))
}
</ul>)

};


export default Todo;
